import React from 'react';
// import { ColorModeScript } from '@chakra-ui/react'
import {
  Flex,
  Heading,
  Spacer,
} from '@chakra-ui/react';
import { Link } from 'react-router-dom';


function Navbar() {
  return (
    <Flex bgGradient="linear(to-l, #19376D, #1A0000)">
      <Heading as="h2" p={3} size="lg" noOfLines={1}>
        <Link to="/">
          <Heading color="#548CFF">DRQS System</Heading>
        </Link>
      </Heading>
      <Spacer />
      <Link to="/learnMore">
        <Heading Heading as="h3" size="lg" m={2.5}>
          Learn More
        </Heading>
      </Link>
    </Flex>
  );
}

export default Navbar;
